def entity_fishing(search_word, check_title_case_for_text_disambiguate=False, check_title_case_for_term_lookup=False, debug=False):
    if debug:
        print(f"\n\nsearch_word: {search_word}")
    highest_raw_name, highest_confidence, highest_wikidata = None, None, None
    term_loopup_res_name, term_loopup_res_conf = None, None
    # Define the endpoint URL
    disambiguate_url = "http://localhost:8090/service/disambiguate"
    term_url = f"http://localhost:8090/service/kb/term/{search_word}"
    search_word_title_case = search_word.title()
    term_url_title_case = f"http://localhost:8090/service/kb/term/{search_word_title_case}"

    # Construct the JSON query
    query_for_disambiguation = {
    "text": "",
    "shortText": search_word,
    "termVector": [],
    "language": {
        "lang": "en"
    },
    "entities": [],
    "mentions": [
        "ner",
        "wikipedia"
    ],
    }
    query_for_disambiguation_title_case = {
    "text": "",
    "shortText": search_word_title_case,
    "termVector": [],
    "language": {
        "lang": "en"
    },
    "entities": [],
    "mentions": [
        "ner",
        "wikipedia"
    ],
    }
    query_for_term_lookup = {"term": search_word}
    query_for_term_lookup_title_case = {"term": search_word_title_case}

    # Set headers (optional)
    headers = {
        "Accept": "application/json",
        "Content-Type": "application/json"
    }

    # Send the POST request with JSON data
    try:
        dist_response = requests.post(disambiguate_url, headers=headers, json=query_for_disambiguation)
    except Exception as e:
        print(f"Error with sending POST request for disambiguation: {e}")
        return None

    # Check the response status
    if dist_response.status_code == 200:
        data = dist_response.json()

        # Find the entity with the highest confidence score
        if data.get('entities'):
            highest_conf_entity = max(
                data['entities'],
                key=lambda x: x.get('confidence_score', 0)
            )
            highest_raw_name = highest_conf_entity.get('rawName', 'Not Available')
            highest_confidence = highest_conf_entity.get('confidence_score', 'Not Available')
            highest_wikidata = highest_conf_entity.get('wikidataId', 'Not Available')
            
            if debug:
                print("Entity with Highest Confidence Score (Disambiguation):")
                print(f"rawName: {highest_raw_name}")
                print(f"confidence_score: {highest_confidence}")
                print(f"WikidataID: {highest_wikidata}")
        else:
            if debug:
                print(f"No entities found in the disambiguation response for '{search_word}'")
            if check_title_case_for_text_disambiguate:
                try:
                    dist_response = requests.post(disambiguate_url, headers=headers, json=query_for_disambiguation_title_case)
                    if dist_response.status_code == 200:
                        data = dist_response.json()
                        if data.get('entities'):
                            highest_conf_entity = max(
                                data['entities'],
                                key=lambda x: x.get('confidence_score', 0)
                            )
                            highest_raw_name = highest_conf_entity.get('rawName', 'Not Available')
                            highest_confidence = highest_conf_entity.get('confidence_score', 'Not Available')
                            highest_wikidata = highest_conf_entity.get('wikidataId', 'Not Available')
                            
                            if debug:
                                print("Entity with Highest Confidence Score (Disambiguation - Title Case):")
                                print(f"rawName: {highest_raw_name}")
                                print(f"confidence_score: {highest_confidence}")
                                print(f"WikidataID: {highest_wikidata}")
                        else:
                            if debug:
                                print(f"No entities found in the disambiguation response for '{search_word_title_case}'")

                except Exception as e:
                    print(f"Error with sending POST request for disambiguation (Title Case): {e}")
                    return None
    else:
        print(f"Unexpected status code for disambiguation: {dist_response.status_code}")
        print(dist_response.text)
        return None
    
    try:
        tlu_response = requests.get(term_url, headers=headers)
    except Exception as e:
        print(f"Error with sending POST request for term look-up: {e}")
        return None
    
    if tlu_response.status_code == 200:
        data = tlu_response.json()
        # Find the entity with the highest confidence score
        if data.get('senses'):
            top_res = data['senses']
            # from top_res, get 'preferred' and 'prob_c' values
            term_loopup_res_name = top_res[0].get('preferred', 'Not Available')
            term_loopup_res_conf = top_res[0].get('prob_c', 'Not Available')
            
            if debug:
                print("Entity with Highest Confidence Score (Term Lookup):")
                print(f"rawName: {term_loopup_res_name}")
                print(f"confidence_score: {term_loopup_res_conf}")
        else:
            if debug:
                print(f"No entities found in the term look-up response for '{search_word}'")
            if check_title_case_for_term_lookup:
                try:
                    tlu_response = requests.get(term_url_title_case, headers=headers)
                    if tlu_response.status_code == 200:
                        data = tlu_response.json()
                        if data.get('senses'):
                            top_res = data['senses']
                            # from top_res, get 'preferred' and 'prob_c' values
                            term_loopup_res_name = top_res[0].get('preferred', 'Not Available')
                            term_loopup_res_conf = top_res[0].get('prob_c', 'Not Available')
                            
                            if debug:
                                print("Entity with Highest Confidence Score (Term Lookup - Title Case):")
                                print(f"rawName: {term_loopup_res_name}")
                                print(f"confidence_score: {term_loopup_res_conf}")
                        else:
                            if debug:
                                print(f"No entities found in the term look-up response for '{search_word_title_case}'")
                except Exception as e:
                    print(f"Error with sending POST request for term look-up (Title Case): {e}")
                    return None
    else:
        print(f"Unexpected status code for term look-up: {tlu_response.status_code}")
        print(tlu_response.text)
        return None

    # if term_loopup_res_name is suffixed by ' (disambiguation)', or (string) or (film), etc., then remove that suffix
    if term_loopup_res_name:
        term_loopup_res_name = re.sub(r" \(.*\)", "", term_loopup_res_name)
        
    return (highest_raw_name, highest_confidence, highest_wikidata, term_loopup_res_name, term_loopup_res_conf)

def fish_for_entities(batch_of_entities_to_fish_for):
    word_freq_dict = {}
    fish_results = None
    for key in tqdm(batch_of_entities_to_fish_for, desc="Getting entity fishing info for batch ..."):
        fish_results = entity_fishing(key, check_title_case_for_text_disambiguate=True, check_title_case_for_term_lookup=True)

        if fish_results:
            wiki_raw_name, confidence, wikidata_identifier, term_loopup_name, term_loopup_confidence = fish_results
        else:
            # if check_title_case_for_text_disambiguate:
            #     # check for title case hits
            #     key_tc = key.title()
            #     fish_results = entity_fishing(key_tc)
            #     if fish_results:
            #         wiki_raw_name, confidence, wikidata_identifier, term_loopup_name, term_loopup_confidence = fish_results
            #     else:
            #         wiki_raw_name, confidence, wikidata_identifier, term_loopup_name, term_loopup_confidence = "", 0, "", "", 0
            # else:
            # do not check for title case hits
            wiki_raw_name, confidence, wikidata_identifier, term_loopup_name, term_loopup_confidence = "", 0, "", "", 0

        # Ensure key has a dictionary entry in word_freq_dict
        if key not in word_freq_dict:
            word_freq_dict[key] = {}

        word_freq_dict[key]["wiki_raw_name"] = wiki_raw_name
        word_freq_dict[key]["wiki_ent_confidence"] = confidence
        word_freq_dict[key]["wikidata_identifier"] = wikidata_identifier
        word_freq_dict[key]["term_lookup_name"] = term_loopup_name
        word_freq_dict[key]["term_lookup_confidence"] = term_loopup_confidence

    return word_freq_dict

async def is_valid_json(json_str):
    try:
        json.loads(json_str)
        return True
    except ValueError:
        return False

num_of_words_in_each_batch = 40
async def process_batch_noise_removal_w_LM(batch, batch_number):
    system_message = """Task: For each word given to you, give it a score in JSON format.\nScoring Rules:\n- If the word is a numeric date or a quantified amount of money, give it a score of 0.\n- If the word is not one of these, give it a score of 1.\n- If you're not sure, use a score between 0 and 1, with up to two decimal places. Strictly score 0 ONLY if you're absolutely certain that it's a date or amount of money. \n\nResponse Format: Each word should have a JSON entry with:\n- "word": the word being scored,\n- "reason": why you gave that score,\n- "score": the score itself.\n\nExample of response:\n```json\n[\n  {"word": "congress", "reason": "something political-related, not a date or money", "score": 1},\n  {"word": "5 million", "reason": "amount of money", "score": 0},\n  {"word": "home loan", "reason": "finance-related, but does not contain any quantity of money, nor is it a date", "score": 1},\n  {"word": "Dec-23", "reason": "a date in month-date format", "score": 0},\n  {"word": "fiscal ", "reason": "finance-related, but does not contain any quantity of money, nor is it a date", "score": 1},\n  {"word": "apple", "reason": "looks like a fruit or company, not a date or money", "score": 1},\n  {"word": "2022", "reason": "a year, date", "score": 0},\n  {"word": "labour", "reason": "something work-related, not a date or money", "score": 1},\n  {"word": "5", "reason": "a number, could be a monetary amount", "score": 0},\n  {"word": "USD", "reason": "currency unit, not a date or money", "score": 1},\n  {"word": "2022-12-31", "reason": "a date in year-month-date format", "score": 0},\n  {"word": "labrador", "reason": "a dog breed, not a date or money", "score": 1},\n  {"word": "department", "reason": "something management-related, not a date or money", "score": 1},\n  {"word": "6th January", "reason": "a date in date-month format", "score": 0},\n  {"word": "steve jobs", "reason": "a person, not a date or money", "score": 1},\n  {"word": "india", "reason": "a country, not a date or money", "score": 1},\n  {"word": "united nations", "reason": "an organization, not a date or money", "score": 1}\n]\n```"""
    batch_start_time = time.time()

    client = AsyncClient()
    msg_list = [
        {'role': 'system', 'content': system_message},
        {'role': 'user', 'content': str(batch)}
    ]
    
    print(f"Starting processing for batch {batch_number} with items: {batch}")
    while True:
        response = await client.chat(model='mistral-nemo', 
                                    messages=msg_list,
                                    # format = "json" # returns empty response if set to json, unsure why
                                    options = {'temperature': 0.4})
        
        # response = await client.chat(model='nemotron-mini', messages=msg_list,
        #                         options = {
        #                         'temperature': 0.4
        #                         })
        response_content = response['message']['content']
        
        if await is_valid_json(response_content):
            print(f"Model responded with valid JSON for batch {batch_number}")
            batch_end_time = time.time()
            diff_time = round(batch_end_time - batch_start_time, 2)
            print(f"Time taken for batch {batch_number}: {diff_time} seconds")
            return json.loads(response_content)
        else:
            try:
                parsed_data = json5.loads(response_content)
                json_output = json.dumps(parsed_data, indent=4)
                batch_end_time = time.time()
                print(f"Correction successful for batch {batch_number}")
                diff_time = round(batch_end_time - batch_start_time, 2)
                print(f"Time taken for batch {batch_number}: {diff_time} seconds")
                return json.loads(json_output)
            except:
                print(f"Invalid JSON response for batch {batch_number}. Retrying...")

async def run_inference_sequentially_for_noise_cleaning(test_list, batch_size=num_of_words_in_each_batch):
    batches = [test_list[i:i + batch_size] for i in range(0, len(test_list), batch_size)]
    print(f"Starting sequential inference with {len(batches)} batches...")
    
    results = []
    for i, batch in enumerate(batches):
        result = await process_batch_noise_removal_w_LM(batch, i)
        results.append(result)
    
    print("All batches completed.")
    
    flat_results = [item for sublist in results for item in sublist if isinstance(item, dict)]
    flat_results_dict = {}
    for item in flat_results:
        word = item.get('word', '')
        word = word.replace("'", "").replace('"', '')
        reason = item.get('reason', '')
        reason = reason.replace("'", "").replace('"', '')
        score = item.get('score', -1)
        if score < 0 or score > 1:
            print(f"\nInvalid score for word '{word}'. item: {item}\n")
            score = -1
        flat_results_dict[word] = {
            'reason': reason,
            'score': score
        }
    
    return flat_results_dict


